import React from 'react'

const ResultsBox = ({playerData}) => {
  return (
    <div className='results-wrapper'>
        <h3 className='summoner-name'>{playerData.name}</h3>
        <h3 className='summoner-level'>{playerData.summonerLevel}</h3>
  </div>
  )
}

export default ResultsBox
